import React from 'react';
import { Link } from 'react-scroll';
import { motion } from 'framer-motion';

function Navigation() {
  return (
    <nav className="d-flex justify-content-between align-items-center">
      <h1 className="text-orange logo">Vincent GÃ¶ke</h1>
      <div className="nav-links d-flex">
        <Link to="hero" smooth={true} duration={800} className="nav-link text-white mx-3">
          Home
        </Link>
        <Link to="work" smooth={true} duration={800} className="nav-link text-white mx-3">
          My Work
        </Link>
        <Link to="about" smooth={true} duration={800} className="nav-link text-white mx-3">
          About
        </Link>
        <Link to="contact" smooth={true} duration={800} className="nav-link text-white mx-3">
          Contact
        </Link>
      </div>
    </nav>
  );
}

function Header() {
  return (
    <motion.header
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      transition={{ duration: 0.8 }}
      className="bg-dark text-white py-4 sticky-top shadow-sm"
    >
      <div className="container">
        <Navigation />
      </div>
    </motion.header>
  );
}

export default Header;
